import React, { Component } from "react";
import "../../normalize.scss";
import "../../base.scss";
import DadosUsuario from "../../components/Cadastro/DadosUsuario";
import View from "../view/view";

class  DadosUser  extends Component {   
  render() {
    console.log(this.props)
    if (this.props.location.state.initCadastro == true) {
    return (
      <View cadastro={true}>
        <DadosUsuario />
      </View>
    )
    }
  };
}

export default DadosUser;
